import styles from './FormReg.module.css'
import BtnCloseForm from '../UI/FuncBtn/CloseFormReg'
import { useState, useEffect } from 'react'

const FormReg = ({ btnCloseForm }) => {
  const [btnClose, setBtnClose] = useState('')

  const handlerCloseBtn = () => {
    setBtnClose('false')
  }

  useEffect(() => btnCloseForm(btnClose), [btnCloseForm, btnClose])

  return (
    <div className={styles.screenHide}>
      <div className={styles.frameFormReg}>
        <div className={styles.closeBtn} onClick={handlerCloseBtn}>
          <BtnCloseForm />
        </div>
        <div className={styles.formReg}>Хотите на пробное занятие?</div>
      </div>
    </div>
  )
}

export default FormReg
